import React from "react";
import "./App.css";

function Info(props) {
  console.log(props);
  return (
    <div className="header">
      <img src={props.src} alt="" className="header__img" />
      <h1 className="header__title">{props.title}</h1>
      <div className="info">
        <img src={props.user} alt="" className="user" />
        <p className="header__desc">
          Lorem, ipsum dolor sit amet consectetur adipisicing elit. Vel odio
          nesciunt consectetur amet commodi veniam expedita officia, officiis
          repudiandae, quis voluptate doloremque rem natus eveniet fugiat.
          Aspernatur laborum voluptatibus reiciendis!
        </p>
      </div>
    </div>
  );
}

const Test = () => {
  return (
    <div>
      <Info
        title="Trung Duong"
        src="https://plus.unsplash.com/premium_photo-1703631159581-36fe0174e4e6?w=500&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxlZGl0b3JpYWwtZmVlZHw3fHx8ZW58MHx8fHx8"
        alt=""
        className="header__img"
        user=<p className="header__desc">
        Lorem, ipsum dolor sit amet consectetur adipisicing elit. Vel odio
        nesciunt consectetur amet commodi veniam expedita officia, officiis
        repudiandae, quis voluptate doloremque rem natus eveniet fugiat.
        Aspernatur laborum voluptatibus reiciendis!
      </p>
      ></Info>
    </div>
  );
};

export default Test;
